import React from 'react';
import './App.css';

class CompletedCourse extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h4><strong>
          {this.props.data.number}: {this.props.data.name}
        </strong></h4>
      </React.Fragment>
    )
  }
}

export default CompletedCourse;
